export function getDictCount(dict, startDateStr, endDateStr) {
    let startDate = moment(startDateStr, "L")
    let endDate = moment(endDateStr, "L").endOf('day');

    let count = 0
    for (let i = 0; i < dict.keys().length; i++) {
      let date = dict.keys()[i]

      if (moment(date, "L").isBetween(startDate, endDate))
        count += dict[date]
    }

    return count
}
